async function getdata() {
  try{
  let response = await fetch('https://kontests.net/api/v1/all');
  let responseJson = await response.json();
  return responseJson;
  } catch(error) {
    console.log(error);
  };
}

function App() {
  var text = "ho";
  const data = getdata();
  console.log(data);
  /*for(var info in data)
  {
    text = text + info + " ";

  }*/
  return data;
}

export default App;
